import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import IntroScreen from './IntroScreen'; // Update path if necessary
import QuizScreen from './QuizScreen'; // Update path if necessary

function App() {
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route exact path="/" component={IntroScreen} />
          <Route exact path="/quiz" component={QuizScreen} />
          {/* Add more routes for different screens/components */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
